import React from 'react'
import './css/welcome.css'
const bg = require ('../img/bg.jpg')

function Welcome (): JSX.Element {
  return <div className={'welcome-page'}>
    <img src={bg} />
    <h1>Welcome to the <span>Trello</span> Copy!</h1>
  </div>
}

export default Welcome
